import './App.css';
import Navbar from './Components/Nabvar/Navbar';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Home from './Pages/Home';
import RecipesTD from './Pages/RecipesTD';
import LoginSignup from './Pages/LoginSignup';

function App() {
  return (
    <div>


      <BrowserRouter>

      <Routes>

        <Route path='/' element={<Home/>}/>
        <Route path='/recipes' element={<RecipesTD category="recipes"/>}/>
        <Route path='/td' element={<RecipesTD category="td"/>}/>

        <Route path='/login' element={<LoginSignup/>}/>

      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
